import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "./App.css";
import MainPage from "./Pages/MainPage";

function App() {
  return (
    <Router>
      <Route path="/" exact component={MainPage} />
      <Route path="/edit:id" exact component={MainPage} />
    </Router>
  );
}

export default App;
